INSERT INTO `actype_tb` (`act_id`, `title`, `description`, `col`) VALUES
(100, 'Accounts Payable', 'This represents balances owed to vendors for goods, supplies, and services purchased on an open account. Accounts payable balances are used in accrual-based accounting, are generally due in 30 or 60 days, and do not bear interest. \n Select this account type if you are setting up open vendor accounts or credit card (purchase) accounts.', 2),
(200, 'Accounts Receivable', 'This represents amounts owed by customers for items or services sold to them when cash is not received at the time of sale. Typically, acounts receivable balances are recorded on sales invoices that include terms of payment. Accounts receivable are used in accrual-based accounting. \n Select this type if you are setting up accrued income that customers owe', 1),
(300, 'Accumumlated Depreciation', 'This is a contra asset account to depreciable (fixed) assets such as buildings, machinery, and equipment. Depreciable basis (expense) is the difference between an asset\'s cost and its estimated salvage value. Recording depreciation is a way to indicate that assets hae declined in serivice potential. Accumulated depreciation represents totla depreciation taken to date on the assets \n Select this account type if you are setting up depreciation accounts for known fixed assets.', 2),
(400, 'Cash', 'This represents deposits in banks available for current operations, plus cash on hand consisting of currency, undeposited checks, drafts, and money orders. \n Select this account type if you are setting up bank checking accounts, petty cash accounts, money market accounts, and certificates of deposit (CDs). ', 1),
(500, 'Cost of Sales', 'This represents the known cost to your business for itms or services when sold to customers. Cost of sales (also nown as cost of goods sold) for inventory items is computed based on inventory costing method (FIFO, LIFO, or Average Cost). \n Select this account type if you are setting up cost-of-goods-sold accounts to be used when selling inventory items.', 1),
(600, 'Equity-doesn\'t close', 'This represents equity that is carried forward from year to year ( like a common stock). Equity is the owner\'s claim against the assets or the owner\'s interest in the entity. These accounts are typically found in corporation-type businesses \n Select this account type if you are a corporation and want to record common stock or other equity intended as owner investment.', 2),
(700, 'Equity-gets Closed', 'This represents equity that is carried forward from year to year (like common stock). Equity is the owner\'s claim against the assets or the owner\'s interest in the entity. These accounts are typically found in corporation-type businesses. \n Select this account type if you are a corporation and want to record common stock or other equity intended as owner investment.', 2),
(800, 'Equity-Retained Earnings', 'This represents the earned capital of the enterprise. Its balance is the cumulative, lifetime earnings of the company that have not been distributed to owners \n You can only have one retained earnings account in Edozzier.', 2),
(900, 'Expenses', 'These represent the costs and liabilities incurred to produce revenues. The assets surrendered or consumed when serving customers indicate company expenses. If income exceeds expenses, nt income results. If expenses exceed income, the business is said to be operating at a net loss. \n Select this account type if you are setting up accunts such as operation expense, travel expense, or charity expense.', 1),
(1000, 'Fixed Assets', 'These represent property, plant, or equipment assets that are acquired for use in a business rather than for resale. They are called fixed assets because they are to be used for long periods of time. Select this account type if you are setting up any of the following: Land, Buildings, Machinery.', 1),
(1100, 'Income', 'Income (also known as revenue) represents the inflow of assets resulting form the sale of products and services to customers. If products income exceeds expenses, net income results. If expenses exceed income, the business is said to be operating at a net loss. \n Select this account type if you are setting up sales revenue accounts. It is common practive to create different income acccounts for each category of revenue that you want to track (for example, retail income, service income, interest income, and so on).', 2),
(1200, 'Inventory', 'This represents the quantity (value) of goods on hand and available for sale at any given time. Inventory is considered to be an asset that is purchased, manufactured (or assembled), and sold to customers for revenue. \n Select this account type if you are setting up assets that are intended for resale. It is common practice to create different accounts for each category of inventory that you want to track.', 1),
(1300, 'Long Term Liabilities', 'This represents those debts tha are not due for a relatively long period of time, usually more than one year. Portions of long-term loans due and notes payable with maturity dates at least a year or more beyond the current balance sheet date are considered to be long-term liabilities. \n Select this account type if you ared setting up long-term liabilities (for example, long-term loans and non current notes payable', 2),
(1400, 'Other Assets', 'This represents those assets that are considered nonworking capital and are not due for a relatively long period of time, usually more than one year or more beyond the current balance sheet date are considered to tbe noncurrent assets \n Select this account type if you are setting up assets such as deposits, organization costs, amortization expense, noncurrent notes receiveable, and so on.', 1),
(1500, 'Other Current Asset', 'This represents those assets that are considered nonworking capital and are due within a short period of time, usually less than a year. Prepaid expnses, employee advances, and notes receivable iwth maturity dates of less than one year of the current balance sheet date are considered to be \'current\' assets', 1),
(1600, 'Other Current Liabilities', 'This represents those debts that are due within a short period time, usally less than a year. The payment of these debts usually requires the use of current assets. \n Select this account type if you are setting up accrued expenses from a vendor, extended lines of credit, short-term loans, sales tax payables, payroll tax payables, client escrow accounts, suspense(clearing) accounts, and so on.', 2);
